import './Footer.css';

const Footer = () => {

    return (
       <div className="App">
          <footer className="footer">
            <div className="container">
              <div className="row">
                 <div className="col">
                   <p>blablabla</p>
                 </div>
                 <div className="d-flex justify-content-center">
                   <a className="icon" href="http://www.facebook.com"><i className="fab fa-facebook-square"></i></a>
                   <a className="icon" href="https://twitter.com/login?lang=fr"><i className="fab fa-twitter-square"></i></a>
                 </div>
              </div>
            </div>
          </footer>
       </div>

    )     
    }
export default Footer;
